import logo from './logo.svg';
import './App.css';
import { withAuthenticator } from '@aws-amplify/ui-react';

function App() {
  return (
    <div className="App">
      <h1>Welcome to My React App</h1>
      <p>You are now logged in.</p>
    </div>
  );
}

export default withAuthenticator(App);
